ISLAMABAD, Mar 3 (APP):Owner of Karachi Kings Salman Iqbal and former cricketers Wasim Akram and Dean Jons on Tuesday called on Prime Minister Imran Khan at the PM Office.
Matters of mutual interest and ongoing Pakistan Super League (PSL) cricket came under discussion during the meeting.
